    false,nt"url": null,nt"notes": "This report provides a hydrogeomorphic
    (HGM) evaluation of ecosystem restoration and management options for floodplains
    located along the Lower Grand River located in north central Missouri. This three
    step process outlines the historical landscape, contemporary changes from presettlement
    conditions, restoration and management options and monitoring and evaluation needs
    for the Refuges. Topics include geomorphology, soils, topography/elevation, climate,
    vegetation and hydrology.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
